import React, { Component } from "react";
import { Layout, Navigation, Header, Drawer, Content, Footer } from "react-mdl";
import "./App.css";
import AboutMeComponent from "../src/component/AboutMeComponent";
import AboutUnsplashComponent from "../src/component/AboutUnsplashComponent";
import ContactComponent from "../src/component/ContactComponent";
import NotFound from "../src/component/NotFound";
import { Container, Row, Col } from "reactstrap";


class App extends Component {
  render() {
    return (
      <div>



            {/* Uses a header that scrolls with the text, rather than staying locked at the top */}
            <div className="demo-big-content" id='navBar'>
              <Layout>
                <Header title="Title" scroll>
                  <Navigation>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                  </Navigation>
                </Header>
                <Drawer title="Title">
                  <Navigation>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                    <a href="#">Link</a>
                  </Navigation>
                </Drawer>
                <Content>
                  <div className="page-content" />
                </Content>
              </Layout>
            </div>



          <Row  className="display">

            <AboutMeComponent />
            <AboutUnsplashComponent />
            <ContactComponent />
            <NotFound />
          </Row>

          <div className="footer">
            <Footer />
          </div>

      </div>
    );
  }
}

export default App;
